import React from 'react';
import michaelJacksonImage from '../assets/image.png';

const ArtistCard = () => {
  return (
    <div className="artist-card">
      <img src="path_to_your_michael_jackson_image.jpg" alt="Michael Jackson" />
      <div>
        <h2>Michael Jackson</h2>
        <p>27,823,904 monthly listeners</p>
      </div>
    </div>
  );
};

export default ArtistCard;
